CREATE TABLE TmpDistrictMaster(
	DistrictID int NOT NULL,
	DistrictName varchar(50) NULL,
	StateID int NULL,
	LocalName text NULL,
	Active char(1) NULL,
	LastModifiedDate TIMESTAMPTZ  NOT NULL,
	LastModifiedBy int NOT NULL,
	MachineAddress varchar(50) NOT NULL,
	ValidFrom TIMESTAMPTZ  NOT NULL,
	ValidTo TIMESTAMPTZ   NOT NULL
	);










select districtid,districtname,localname,active,lastmodifieddate from TmpDISTRICTMASTER where stateid=16 order by districtname